ListingCategoriesPage:
fragment ListingCategoryRow on ListingCategory {
  id
  name
  path
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingCategoriesPage {
  listingCategories {
    entities {
      ...ListingCategoryRow
    }
    paging {
      ...Paging
    }
  }
}

ListingQueriesPage:
fragment ListingQueryRow on ListingQuery {
  id
  url
  searchParams
  config
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingQueriesPage {
  listingQueries {
    entities {
      ...ListingQueryRow
    }
    paging {
      ...Paging
    }
  }
