ListingsPage:
fragment ListingRow on Listing {
  id
  title
  image
  condition
  stock
  price
  shippingPrice
  purchaseOptions
  location
  listingAt
  listingEndAt
  returns
  buyItNowPrice
  currency
  bidsCount
  sellerId
  seller {
    id
    username
    totalFeedback
    feedbackText
  }
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingsPage {
  listings(
    paging: { pageSize: 240 }
    orderBy: [{ field: "title", direction: DESC }]
  ) {
    entities {
      ...ListingRow
    }
    paging {
      ...Paging
    }
  }
}

OrdersPage:
fragment OrderRow on Order {
  id
  state
  date
  inventoryId
  inventory {
    id
    provider
  }
  sellerId
  seller {
    id
    username
  }
  shipments {
    id
    paidAt
    shippedAt
    deliveredAt
    receivedAt
    trackingNumber
    currentStep
  }
  items {
    itemId
    title
    price
    quantity
    itemsTotal
    shippingCost
    total
  }
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query OrdersPage($orderBy: [OrderByInput!]) {
  orders(paging: { pageSize: 240 }, orderBy: $orderBy) {
    entities {
      ...OrderRow
    }
    paging {
      ...Paging
    }
  }
}

ShipmentsPage:
fragment ShipmentItem on Shipment {
  id
  orderId
  order {
    id
    total
  }
  value
  paidAt
  shippedAt
  deliveredAt
  receivedAt
  trackingNumber
  currentStep
}

fragment OrderRow on Order {
  id
  state
  date
  inventoryId
  inventory {
    id
    provider
  }
  sellerId
  seller {
    id
    username
  }
  shipments {
    id
    paidAt
    shippedAt
    deliveredAt
    receivedAt
    trackingNumber
    currentStep
  }
  items {
    itemId
    title
    price
    quantity
    itemsTotal
    shippingCost
    total
  }
}


fragment ShipmentRow on Shipment {
  ...ShipmentItem
  order {
    ...OrderRow
  }
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ShipmentsPage($filter: ShipmentFilterInput, $orderBy: [OrderByInput!]) {
  shipmentAggregate {
    state
    count
    total
  }
  shipments(filter: $filter, paging: { pageSize: 240 }, orderBy: $orderBy) {
    entities {
      ...ShipmentRow
    }
    paging {
      ...Paging
    }
  }
}

